import React from 'react'
import { withStyles } from "@material-ui/styles";

const styles = {
  root: {
    background: "grey",
    border: "1px solid yellow",
    padding: "16px",
  },
  avatarContainer:{
    width:"40px",
    height:"40px",
    borderRadius:"50%",
    background:"white",
    display:"flex",
    alignItems:"center",
    justifyContent:"center",
    overflow:"hidden"
  },
  info:{
    border:"1px solid blue",
  "& p":{
    margin:"0px",
    textAlign:"center"
  }
  }
}

function TeamMember(props) {
  const { classes } = props;
  return (
    <div className={classes.root}>
      <div className={classes.avatarContainer}>img</div>
      <div className={classes.info}>
        <p>Sam Li</p>
        <p>Senior Product Manager</p>
      </div>
    </div>
  )
}

export default withStyles(styles)(TeamMember);
